members.member:
 
Customize the DateTime format in the PDF Viewer
 
 
This property allows users to specify their desired format for displaying date and time in the PDF Viewer
 

@using Syncfusion.Blazor.SfPdfViewer 
<SfPdfViewer2 DateTimeFormat="@dateFormat" DocumentPath="@DocumentPath" Height="800px" Width="100%"> 
</SfPdfViewer2> 
@code{ 
private string dateFormat = "HH:mm:ss yyyy-MM-dd"; 
private string DocumentPath { get; set; } = "wwwroot/data/PDF_succintly.pdf"; 
}

